g1035.d:
βρῶσις brōsis, bro'-sis; from the base of G977; (abstractly) eating (literally or figuratively);
 by extension (concretely) food (literally or figuratively):—eating,
 food, meat.

g1067.d:
γέεννα géenna, gheh'-en-nah; of Hebrew origin (H1516 and H2011); valley of (the son of) Hinnom;
 ge-henna (or Ge-Hinnom), a valley of Jerusalem, used (figuratively) as
 a name for the place (or state) of everlasting punishment:—hell.

g111.d:
ἀθέμιτος athémitos, ath-em'-ee-tos; from G1 (as a negative particle) and a derivative of θέμις thémis (statute; 
 from the base of G5087); illegal; by implication,
 flagitious:—abominable, unlawful thing.

g1336.d:
†διηνεκής diēnekḗs, dee-ay-nek-es'; neuter of a compound of G1223 and a derivative of an alternate of G5342; 
 carried through, i.e. (adverbially with G1519 and G3588 prefixed)
 perpetually:—+ continually, for ever.

g138.d:
†αἱρέομαι hairéomai, hahee-reh'-om-ahee; probably akin to G142; to take for oneself, i.e. to prefer:—choose. 
 Some of the forms are borrowed from a cognate ἕλλομαι héllomai hel'-lom-ahee;
 which is otherwise obsolete.

g1388.d:
δόλος dólos, dol'-os; from an obsolete primary verb, δέλλω déllō (probably meaning to decoy; 
 compare G1185); a trick (bait), i.e. (figuratively) wile:—craft,
 deceit, guile, subtilty.

g1401.d:
†δοῦλος doûlos, doo'-los; from G1210; a slave (literal or figurative, involuntary or voluntary;
 frequently, therefore in a qualified sense of subjection or
 subserviency):—bond(-man), servant.

g1416.d:
δύνω dýnō, doo'-no; prolonged forms of an obsolete primary
    δύο dýo  doo'-o (to sink); 

 to go "down":—set.

g1484.d:
ἔθνος éthnos, eth'-nos; probably from G1486; a race (as of the same habit), i.e. a tribe;
 specially, a foreign (non-Jewish) one (usually, by implication,
 pagan):—Gentile, heathen, nation, people.

g1735.d:
†ἐνδέχεται endéchetai, en-dekh'-et-ahee; third person singular present of a compound of G1722 and G1209; 
 (impersonally) it is accepted in, i.e. admitted (possible):—can (+
 not) be.

g1793.d:
ἐντυγχάνω entynchánō, en-toong-khan'-o; from G1722 and G5177; to chance upon, i.e. (by implication) confer with;
 by extension to entreat (in favor or against):—deal with, make
 intercession.

g1984.d:
ἐπισκοπή episkopḗ, ep-is-kop-ay'; from G1980; inspection (for relief); by implication, superintendence;
 specially, the Christian "episcopate":—the office of a "bishop",
 bishoprick, visitation.

g2005.d:
ἐπιτελέω epiteléō, ep-ee-tel-eh'-o; from G1909 and G5055; to fulfill further (or completely), i.e. execute;
 by implication, to terminate, undergo:—accomplish, do, finish, (make)
 (perfect), perform(X -ance).

g2077.d:
ἔστω éstō, es'-to; second person singular present imperative of G1510; be thou; 

 also  ἔστωσαν éstōsan  es'-to-san, third person of the same;

 let them be:—be.

g2078.d:
ἔσχατος éschatos, es'-khat-os; a superlative probably from G2192 (in the sense of contiguity); 
 farthest, final (of place or time):—ends of, last, latter end,
 lowest, uttermost.

g2106.d:
εὐδοκέω eudokéō, yoo-dok-eh'-o; from G2095 and G1380; to think well of, i.e. approve (an act);
 specially, to approbate (a person or thing):—think good, (be well)
 please(-d), be the good (have, take) pleasure, be willing.

g211.d:
ἀλάβαστρον alábastron, al-ab'-as-tron; neuter of ἀλάβαστρος alábastros (of uncertain derivation), the name of a stone; 
 properly, an "alabaster" box, i.e. (by extension) a perfume vase (of
 any material):—(alabaster) box.

g2159.d:
εὐτόνως eutónōs, yoo-ton'-oce; adverb from a compound of G2095 and a derivative of τείνω teínō (to stretch); 
 in a well-strung manner, i.e. (figuratively) intensely (in a good
 sense, cogently; in a bad one, fiercely):—mightily, vehemently.

g2270.d:
ἡσυχάζω hēsycházō, hay-soo-khad'-zo; from the same as G2272; to keep still (intransitively), i.e. refrain
 from labor, meddlesomeness or speech:—cease, hold peace, be quiet,
 rest.

g2469.d:
†Ἰσκαριώτης Iskariṓtēs, is-kar-ee-o'-tace; of Hebrew origin (probably H377 and H7149); inhabitant of Kerioth;
 Iscariotes (i.e. Keriothite), an epithet of Judas the
 traitor:—Iscariot.

g2479.d:
ἰσχύς ischýs, is-khoos'; from a derivative of ἰς is (force; compare ἔσχον éschon, a form of G2192);
 forcefulness (literally or figuratively):—ability, might(-ily),
 power, strength.

g2744.d:
†καυχάομαι kaucháomai, kow-khah'-om-ahee; from some (obsolete) base akin to that of αὐχέω auchéō (to boast) and G2172; 
 to vaunt (in a good or a bad sense):—(make) boast, glory, joy,
 rejoice.

g276.d:
ἀμετάθετος ametáthetos, am-et-ath'-et-os; from G1 (as a negative particle) and a derivative of G3346; 
 unchangeable, or (neuter as abstract)
 unchangeability:—immutable(-ility).

g2865.d:
κομίζω komízō, kom-id'-zo; from a primary κομέω koméō (to tend, i.e. take care of); properly, to
 provide for, i.e. (by implication) to carry off (as if from harm;
 genitive case obtain):—bring, receive.

g2889.d:
κόσμος kósmos, kos'-mos; probably from the base of G2865; orderly arrangement, i.e. decoration;
 by implication, the world (in a wide or narrow sense, including its
 inhabitants, literally or figuratively (morally)):—adorning, world.

g3075.d:
λυμαίνομαι lymaínomai, loo-mah'-ee-nom-ahee; middle voice from a probably derivative of G3089 (meaning filth); 
 properly, to soil, i.e. (figuratively) insult (maltreat):—make havock
 of.

g318.d:
†ἀνάγκη anánkē, an-ang-kay'; from G303 and the base of G43; constraint (literally or figuratively);
 by implication, distress:—distress, must needs, (of)
 necessity(-sary), needeth, needful.

g3345.d:
μετασχηματίζω metaschēmatízō, met-askh-ay-mat-id'-zo; from G3326 and a derivative of G4976; to transfigure or disguise;
 figuratively, to apply (by accommodation):—transfer, transform
 (self).

g3403.d:
†μιμνήσκω mimnḗskō, mim-nace'-ko; a prolonged form of G3415 (from which some of the tenses are borrowed); 
 to remind, i.e. (middle voice) to recall to mind:—be mindful,
 remember.

g3501.d:
†νέος néos, neh'-os; including the comparative νεότερος neóteros neh-o'-ter-os; a primary word; 
 "new", i.e. (of persons) youthful, or (of things) fresh; figuratively,
 regenerate:—new, young.

g3586.d:
ξύλον xýlon, xoo'-lon; from another form of the base of G3582; timber (as fuel or material);
 by implication, a stick, club or tree or other wooden article or
 substance:—staff, stocks, tree, wood.

g3619.d:
οἰκοδομή oikodomḗ, oy-kod-om-ay'; feminine (abstract) of a compound of G3624 and the base of G1430; 
 architecture, i.e. (concretely) a structure; figuratively,
 confirmation:—building, edify(-ication, -ing).

g3735.d:
ὄρος óros, or'-os; probably from an obsolete ὄρω órō (to rise or "rear"; perhaps akin to G142;
 compare G3733); a mountain (as lifting itself above the plain):—hill,
 mount(-ain).

g378.d:
ἀναπληρόω anaplēróō, an-ap-lay-ro'-o; from G303 and G4137; to complete; by implication, to occupy, supply;
 figuratively, to accomplish (by coincidence ot obedience):—fill up,
 fulfill, occupy, supply.

g3796.d:
ὀψέ opsé, op-seh'; from the same as G3694 (through the idea of backwardness); 
 (adverbially) late in the day; by extension, after the close of the
 day:—(at) even, in the end.

g3813.d:
παιδίον paidíon, pahee-dee'-on; neuter diminutive of G3816; a childling (of either sex), i.e.
 (properly), an infant, or (by extension) a half-grown boy or girl;
 figuratively, an immature Christian:—(little, young) child, damsel.

g3819.d:
πάλαι pálai, pal'-ahee; probably another form for G3825 (through the idea of retrocession); 
 (adverbially) formerly, or (by relatively) sometime since;
 (elliptically as adjective) ancient:—any while, a great while ago,
 (of) old, in time past.

g3829.d:
πανδοχεῖον pandocheîon, pan-dokk-i'-on; neuter of a presumed compound of G3956 and a derivative of G1209; 
 all-receptive, i.e. a public lodging-place (caravanserai or
 khan):—inn.

g384.d:
ἀνασκευάζω anaskeuázō, an-ask-yoo-ad'-zo; from G303 (in the sense of reversal) and a derivative of G4632; 
 properly, to pack up (baggage), i.e. (by implication, and
 figuratively) to upset:—subvert.

g4106.d:
πλάνη plánē, plan'-ay; feminine of G4108 (as abstractly); objectively, fraudulence;
 subjectively, a straying from orthodoxy or piety:—deceit, to deceive,
 delusion, error.

g4141.d:
πλήσσω plḗssō, place'-so; apparently another form of G4111 (through the idea of flattening out); 
 to pound, i.e. (figuratively) to inflict with (calamity):—smite. 
 Compare G5180.

g4221.d:
ποτήριον potḗrion, pot-ay'-ree-on; neuter of a derivative of the alternate of G4095; a drinking-vessel; by
 extension, the contents thereof, i.e. a cupful (draught);
 figuratively, a lot or fate:—cup.

g4286.d:
πρόθεσις próthesis, proth'-es-is; from G4388; a setting forth, i.e. (figuratively) proposal (intention);
 specially, the show-bread (in the Temple) as exposed before
 God:—purpose, shew(-bread).

g4350.d:
προσκόπτω proskóptō, pros-kop'-to; from G4314 and G2875; to strike at, i.e. surge against (as water);
 specially, to stub on, i.e. trip up (literally or figuratively):—beat
 upon, dash, stumble (at).

g4371.d:
προσφάγιον prosphágion, pros-fag'-ee-on; neuter of a presumed derivative of a compound of G4314 and G5315; 
 something eaten in addition to bread, i.e. a relish (specially, fish;
 compare G3795):—meat.

g4758.d:
στρατολογέω stratologéō, strat-ol-og-eh'-o; from a compound of the base of G4756 and G3004 (in its original sense); 
 to gather (or select) as a warrior, i.e. enlist in the army:—choose
 to be a soldier.

g4864.d:
συναγωγή synagōgḗ, soon-ag-o-gay'; from (the reduplicated form of) G4863; an assemblage of persons;
 specially, a Jewish "synagogue" (the meeting or the place); by
 analogy, a Christian church:—assembly, congregation, synagogue.

g505.d:
ἀνυπόκριτος anypókritos, an-oo-pok'-ree-tos; from G1 (as a negative particle) and a presumed derivative of G5271; 
 undissembled, i.e. sincere:—without dissimulation (hypocrisy),
 unfeigned.

g5056.d:
τέλος télos, tel'-os; from a primary τέλλω téllō (to set out for a definite point or goal); 
 properly, the point aimed at as a limit, i.e. (by implication) the
 conclusion of an act or state (termination (literally, figuratively or
 indefinitely), result (immediate, ultimate or prophetic), purpose);
 specially, an impost or levy (as paid):—+ continual, custom,
 end(-ing), finally, uttermost. Compare G5411.

g506.d:
ἀνυπότακτος anypótaktos, an-oo-pot'-ak-tos; from G1 (as a negative particle) and a presumed derivative of G5293; 
 unsubdued, i.e. insubordinate (in fact or temper):—disobedient, that
 is not put under, unruly.

g5143.d:
τρέχω tréchō, trekh'-o; apparently a primary verb (properly, θρέχω thréchō; compare G2359); which
 uses δρέμω drémō drem'-o (the base of G1408) as alternate in certain tenses;
 to run or walk hastily (literally or figuratively):—have course, run.

g5215.d:
ὕμνος hýmnos, hoom'-nos; apparently from a simpler (obsolete) form of ὑδέω hydéō (to celebrate; 
 probably akin to G103; compare H5667); a "hymn" or religious ode (one of
 the Psalms):—hymn.

g5274.d:
ὑπολαμβάνω hypolambánō, hoop-ol-am-ban'-o; from G5259 and G2983; to take from below, i.e. carry upward;
 figuratively, to take up, i.e. continue a discourse or topic;
 mentally, to assume (presume):—answer, receive, suppose.

g5302.d:
ὑστερέω hysteréō, hoos-ter-eh'-o; from G5306; to be later, i.e. (by implication) to be inferior;
 generally, to fall short (be deficient):—come behind (short), be
 destitute, fail, lack, suffer need, (be in) want, be the worse.

g5342.d:
φέρω phérō, fer'-o; a primary verb (for which other, and apparently not cognate ones are
 used in certain tenses only; namely,

    οἴω oíō  oy'-o;   
 and ἐνέγκω enénkō  en-eng'-ko; 

 to "bear" or carry (in a very wide application, literally and
 figuratively, as follows):—be, bear, bring (forth), carry, come, +
 let her drive, be driven, endure, go on, lay, lead, move, reach,
 rushing, uphold.

g5421.d:
φρέαρ phréar, freh'-ar; of uncertain derivation; a hole in the ground (dug for obtaining or
 holding water or other purposes), i.e. a cistern or well;
 figuratively, an abyss (as a prison):—well, pit.

g5467.d:
χαλεπός chalepós, khal-ep-os'; perhaps from G5465 through the idea of reducing the strength; 
 difficult, i.e. dangerous, or (by implication) furious:—fierce,
 perilous.

g5530.d:
χράομαι chráomai, khrah'-om-ahee; middle voice of a primary verb (perhaps rather from G5495, to handle); 
 to furnish what is needed; (give an oracle, "graze" (touch slightly),
 light upon, etc.), i.e. (by implication) to employ or (by extension)
 to act towards one in a given manner:—entreat, use. Compare G5531;
 G5534.

g5587.d:
ψιθυρισμός psithyrismós, psith-oo-ris-mos'; from a derivative of ψίθος psíthos (a whisper; by implication, a slander;
 probably akin to G5574); whispering, i.e. secret
 detraction:—whispering.

g568.d:
ἀπέχω apéchō, ap-ekh'-o; from G575 and G2192; (actively) to have out, i.e. receive in full;
 (intransitively) to keep (oneself) away, i.e. be distant (literally or
 figuratively):—be, have, receive.

g652.d:
ἀπόστολος apóstolos, ap-os'-tol-os; from G649; a delegate; specially, an ambassador of the Gospel;
 officially a commissioner of Christ ("apostle") (with miraculous
 powers):—apostle, messenger, he that is sent.

g677.d:
ἀπρόσκοπος apróskopos, ap-ros'-kop-os; from G1 (as a negative particle) and a presumed derivative of G4350; 
 actively, inoffensive, i.e. not leading into sin; passively,
 faultless, i.e. not led into sin:—none (void of, without) offence.

g795.d:
ἀστοχέω astochéō, as-tokh-eh'-o; from a compound of G1 (as a negative particle) and στοίχος stoíchos (an aim); 
 to miss the mark, i.e. (figuratively) deviate from truth:—err,
 swerve.

g816.d:
ἀτενίζω atenízō, at-en-id'-zo; from a compound of G1 (as a particle of union) and τείνω teínō (to stretch); 
 to gaze intently:—behold earnestly (stedfastly), fasten (eyes), look
 (earnestly, stedfastly, up stedfastly), set eyes.

g847.d:
αὐτοῦ autoû, ow-too'; genitive (i.e. possessive) of G846, used as an adverb of location; 
 properly, belonging to the same spot, i.e. in this (or that)
 place:—(t-)here.

g868.d:
ἀφίστημι aphístēmi, af-is'-tay-mee; from G575 and G2476; to remove, i.e. (actively) instigate to revolt;
 usually (reflexively) to desist, desert, etc.:—depart, draw (fall)
 away, refrain, withdraw self.

g922.d:
βάρος báros, bar'-os; probably from the same as G939 (through the notion of going down; 
 compare G899); weight; in the New Testament only, figuratively, a load,
 abundance, authority:—burden(-some), weight.

g96.d:
ἀδόκιμος adókimos, ad-ok'-ee-mos; from G1 (as a negative particle) and G1384; unapproved, i.e. rejected;
 by implication, worthless (literally or morally):—castaway, rejected,
 reprobate.
